import React from 'react';
import {
  BrowserRouter as Router,
  Switch,
  Link,
  Route,
  Redirect,
} from 'react-router-dom';
import './App.css';
import Header from './components/header'

const App = () => {
  return (
    <Router>
      <Switch>
        <Route path={'/'} exact>
          <div className="App">
            <Header />
          </div>
        </Route>
      </Switch>
    </Router>
  );
}

export default App;
